import React, { Component } from "react";
import ".././images";

export default class Body extends Component {
  render() {
    const style = {
      marginTop: "400px"
    };

    return (
      <div>
        <img style={style} src={"../images/mother.png"} />
        <img style={style} src={"../images/bluehour.png"} />
        <img style={style} src={"../images/curse.png"} />
        <img style={style} src={"../images/pitbulls.png"} />
        <img style={style} src={"../images/killerKids.png"} />
        <img style={style} src={"../images/nightwatch.png"} />
        <img style={style} src={"../images/allSummer.png"} />
        <img style={style} src={"../images/winter.png"} />
      </div>
    );
  }
}
